create  schema  example;
use example;
CREATE TABLE `xs_user` (
  `USER_ID` varchar(32)  NOT NULL COMMENT '用户ID',
  `LOGIN_NAME` varchar(64)  NOT NULL,
  `PASSWORD` varchar(255)  NOT NULL,
  `STATUS` varchar(16)  NOT NULL,
  `USER_NAME` varchar(32)  NOT NULL,
  `GENDER` varchar(2)  NOT NULL DEFAULT '1',
  `MOBILE` varchar(32)  NOT NULL,
  `EMAIL` varchar(128)  NOT NULL,
  `USER_TYPE` varchar(16)  NOT NULL,
  `ACCOUNT_EXPIRE_DATE` varchar(14)  NOT NULL,
  `PWD_EXPIRE_DATE` varchar(14) NOT NULL,
  `IS_LOCKED` varchar(2)  NOT NULL,
  `PWD_REVISE_DATE` varchar(14) COLLATE utf8_bin DEFAULT NULL COMMENT '密码修改时间',
  `PWD_REVISOR` varchar(32)  DEFAULT NULL COMMENT '密码修改人',
  `ARCHIVE_FLAG` varchar(1)  DEFAULT NULL COMMENT '归档标记',
  `USER_GROUP_ENAME` varchar(32)  DEFAULT NULL COMMENT '用户组',
  `ORG_ID` varchar(32)  DEFAULT ' ',
  PRIMARY KEY (`USER_ID`) USING BTREE,
  UNIQUE KEY `XS_USER_LOGIN_NAME_UINDEX` (`LOGIN_NAME`) USING BTREE,
  KEY `IDX_XS_USER_LOGIN_NAME` (`LOGIN_NAME`) USING BTREE,
  KEY `IDX_XS_USER_ORG_ID` (`ORG_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='用户信息表';

CREATE TABLE `org`  (
  `FD_ORG_ID` varchar(32)   NOT NULL COMMENT '部门id',
  `FD_ORG_NAME` varchar(32)  NOT NULL COMMENT '部门名称',
  `FD_ORG_DESC` varchar(32)  NOT NULL COMMENT '部门描述及',
  `FD_PARENT_FD_ORG_ID` varchar(32)  COMMENT '父部门名称',
  PRIMARY KEY (`FD_ORG_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='组织机构表';

CREATE TABLE `project`  (
  `FD_PROJECT_ID` varchar(32)   NOT NULL COMMENT '项目id',
  `FD_PROJECT_NAME` varchar(255)   NOT NULL COMMENT '项目名称',
  `FD_PRODUCT_ID` varchar(64)   NOT NULL COMMENT '产品类型id',
  `FD_PROJECT_MANAGER` varchar(32)   NOT NULL COMMENT '项目经理',
  `FD_PROJECT_AMOUNT` DECIMAL    NOT NULL  DEFAULT  0 COMMENT '金额',
  `FD_PROJECT_RATE` DECIMAL NOT NULL  DEFAULT 0 COMMENT '收益率',
  `FD_PROJECT_STATUS` varchar(32) NOT NULL DEFAULT ' ' COMMENT '项目状态',
   PRIMARY KEY (`FD_PROJECT_ID`) USING BTREE,
   UNIQUE KEY `IDX_PROJECT_FD_PROJECT_NAME` (`FD_PROJECT_NAME`) USING BTREE,
   KEY `IDX_PROJECT_FD_PRODUCT_ID` (`FD_PRODUCT_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='项目表';

CREATE TABLE `product`  (
  `FD_PRODUCT_ID` varchar(32)   NOT NULL COMMENT '产品类型id',
  `FD_PRODUCT_CNAME` varchar(255)   NOT NULL COMMENT '产品中文名',
  `FD_PRODUCT_ENAME` varchar(255)   NOT NULL COMMENT '产品英文',
  `FD_PRODUCT_ATTR1` varchar(255)   NOT NULL COMMENT '产品属性1',
  `FD_PRODUCT_ATTR2` varchar(255)   NOT NULL COMMENT '产品属性2',
  `FD_PRODUCT_ATTR3` varchar(255)   NOT NULL COMMENT '产品属性3',
  PRIMARY KEY (`FD_PRODUCT_ID`) USING BTREE,
  UNIQUE KEY `PRODUCT_FD_PRODUCT_CNAME` (`FD_PRODUCT_CNAME`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='产品表';




